Les sites marchands ne livrent pas les DOM-TOM ?
Ce n'est plus un problème grâce à Shopîles : nous sommes une plateforme de réexpédition de colis à destination de l'outre-mer.

Comment ça marche ?

- Inscrivez vous sur shopiles.fr afin de récupérer votre adresse de livraison en métropole chez Shopîles;

- Nous vous notifions par mail dès réception de votre colis;

- Téléchargez la facture de vos achats, groupez vos colis en les ajoutant au panier et choisissez le transporteur;

-Payez les frais de réexpédition et suivez la livraison de votre colis groupé depuis votre espace client.

Les sites discounts, ventes privées, ou boutique TV ne sont plus réservés qu'aux habitants de la métropole !

La page Facebook de VINCI Energies est un espace d’échange d’idées et d’opinions qui s’inscrit dans un esprit d’ouverture et de respect mutuel. 

Les administrateurs de la page Facebook de VINCI Energies se réservent donc le droit de supprimer : 

- les messages à caractère raciste, xénophobe, révisionniste, négationniste ; 
- les messages haineux, diffamatoires, agressifs ou choquants qui attaquent ou dévalorisent un groupe en raison de la race, l'origine ethnique, la religion, le handicap, le sexe, l'âge ou l'orientation/identité sexuelle ; 
- les incitations à la haine raciale, les appels à la violence ou au meurtre ;
- les messages à caractères pornographiques, pédophiles ou obscènes ;
les insultes personnelles entre participants ; 
- les messages portant atteinte à la vie privée d’autres participants ou de tiers ou la divulgation d'informations personnelles d'autres membres ; 
- les messages publicitaires et commerciaux, les communiqués d’organisations politiques, syndicales ; 
- les messages visant à discréditer les autres commentaires et publications dans un but non constructif ;
- les messages hors-sujet ou incompréhensibles. 

- La déclaration des droits et obligations de Facebook s'applique à tous les utilisateurs de la page de VINCI Energies. (https://www.facebook.com/legal/terms)

Insight Global’s social media presence is designed to share information about our company with our followers and encourage engagement with our clients, employees and the larger community.  While many posts include information that is not directly related to our core business (e.g., charitable initiatives, community events and similar happenings), we expect that all posts remain respectful of other followers, not contain profane, obscene or offensive material, and protect the lawful interests of Insight Global and others. Insight Global reserves the right to remove any post that it considers inappropriate, as determined in its sole discretion.  Examples of posts that may be removed include posts that contain:

•	Proprietary information of Insight Global or others;
•	Threatening, abusive, defamatory, indecent, graphic, salacious, or otherwise objectionable words or images;
•	Depictions, endorsements, or suggestions of illegal activity;
•	Fraudulent, deceptive or misleading statements; or
•	Spam, advertisements or solicitations for business not directly related to Insight Global’s products and services.

We value your feedback and encourage our followers to contact a local Insight Global branch to discuss any issues. Thank you for following Insight Global!
